class Contact extends Component {
  render() {
    return (
      <div>
         <p className=""><Icon className="phone-icon" name='phone square large' />Téléphone: 06 43 54 52 28</p>
         <p className=""><Icon className="email-icon" name='mail square large' />Mail: lisaferrier@outlook.com</p>
         <p className=""><Icon className="adress-icon" name='map marker alternate large' />Adresse: Rue Brueys, Aix-en-Provence</p>
         <p className=""><Icon className="linkedin-icon" name='linkedin square large' />LinkedIn : Lisa Ferrier</p>
      </div>
    );
  }
}

export default Contact;
